        <div class="lg:w-1/2 xl:w-1/3" id="daybreak">
            <h2>Daybreak</h2>
            <span class="text-sm text-gray-300">2023 &mdash; Present</span>
            <p>
                Daybreak is my 2D RPG engine for building interactive stories. It has a specialised lighting engine for providing dynamic
                weather and lighting effects for creating beautiful scenes and engaging gameplay.
            </p>
        </div>
        <div class="lg:w-1/2 xl:w-1/3" id="scapegoat">
            <h2>Scapegoat</h2>
            <span class="text-sm text-gray-300">2025 &mdash; Present</span>
            <p>
                Scapegoat is my project to revive the video game Hyper Scape through reverse engineering the game client and re-implementing
                back-end servers.
            </p>
        </div>
        <div class="lg:w-1/2 xl:w-1/3" id="skeldjs">
            <h2>SkeldJS</h2>
            <span class="text-sm text-gray-300">2021 &mdash; 2025</span>
            <p>
                A suite of TypeScript tools and programs for developing bots, libraries and mods for the video game Among Us. Includes a
                private server implementation, a programmable client, with a full re-implementation of the game's logic.
                <br>
                <b>Links:</b> <a href="https://github.com/SkeldJS/SkeldJS">Repository</a>
            </p>
        </div>
        <div class="lg:w-1/2 xl:w-1/3" id="raincode">
            <h2>Raincode</h2>
            <span class="text-sm text-gray-300">2021 &mdash; 2023</span>
            <p>
                My college project to build a competitive programming platform for friends to battle in different game modes and programming
                languages. With it, I wrote a 100,000 word report on the development process.
            </p>
